import React,{useEffect} from 'react'
import mainmenuAction from '../Store/Action/MainmenuAction';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';

const HeaderMenu = () => {
    const dispatch = useDispatch()
    const MainMenuCategory = useSelector(state => state.MainMenuReducer.payload)
    console.log(MainMenuCategory)
    useEffect(() => {
        dispatch(mainmenuAction)
    }, [dispatch])
    return (
        <>
            <div className='container'>
                <div className='main-menu'>
                    <ul className='menu'>
                        {MainMenuCategory ? MainMenuCategory.map((item) => {
                            return (<Link to={`/product-listing-pages/${item.slug}`}><li className='sublist-menu '>{item.name}</li></Link>)
                        }) : null}

                    </ul>
                </div>
            </div>
        </>
    )
}

export default HeaderMenu
